    @Test
    public void MakeMyTradeList_WhenValidString_ExpectValidTradeList(){
        ObjectConverter oc = MakeObjectConverter();
        String data = "{\"success\":\"1\",\"return\":[{\"tradeid\":\"48338454\",\"tradetype\":\"Sell\",\"datetime\":\"2014-06-01 15:28:02\",\"tradeprice\":\"0.00000851\",\"quantity\":\"13.85809313\",\"fee\":\"0.000000290\",\"total\":\"0.00011793\",\"initiate_ordertype\":\"Sell\",\"order_id\":\"96872051\"}]}";
    
        List<MarketTradeVerbose> trades = oc.MakeMyTradeList(data);
        
        // Assert
        assertNotNull(trades);
        assertFalse(trades.isEmpty());
        MarketTradeVerbose mtv = trades.get(0);
        assertEquals("Sell", mtv.TransactedTradeType);
        assertEquals("2014-06-01 15:28:02", mtv.DateTime);
        assertEquals(0.00000851, mtv.Price,0.000000001);
        assertEquals(13.85809313, mtv.Qty,0.000000001);
        assertEquals(0.000000290, mtv.Fee,0.000000001);
        assertEquals("Sell", mtv.InitiatedType);
        assertEquals("96872051", mtv.OrderID);
        assertEquals("48338454", mtv.TradeID);
    }
    
